import React from 'react'
import FeaturedProducts from '../../componets/FeaturedProducts/FeaturedProducts'
import "./Home.scss"

const Home = () => {
  return (
    <div className='home'>
      <FeaturedProducts type="featured"/>
      <Categories/>
      <FeaturedProducts type="trending"/>
    </div>
  )
}

export default Home
